	public static int[] NUMBERS;
	public static int N;
	
	// This variable must equal to N so that
	// threads must continue
	public static AtomicInteger ROUND_COUNTER = new AtomicInteger(0);
	public static boolean IS_FINISHED = false;
	
	public static List<Comparer> COMPARER_LIST = new ArrayList<Comparer>();
	
	// k such that 2^k = N
	public static int K;
	public static int TOTAL_BLOCKS_PART1;
	public static int TOTAL_BLOCKS_PART2;
	public static int TOTAL_BLOCKS;
	
	public static final boolean SHOULD_LOG = false; 

	public static void main(String[] args) throws InterruptedException{
		setup();
		new BitonicSorter().process();
	}
	
	private static void setup() {
		NUMBERS = generateNumbers();
		N = NUMBERS.length - 1;
		K = (int) (Math.log(N) / Math.log(2));
		TOTAL_BLOCKS_PART1 = sumOfOneToN(K - 1);
		TOTAL_BLOCKS_PART2 = K;
		TOTAL_BLOCKS = TOTAL_BLOCKS_PART1 + TOTAL_BLOCKS_PART2;
	}

	public void process2(){
		System.out.println("Starting: ");
		System.out.println("Number of Integers: " + N);		
		
		Semaphore semaphore = new Semaphore(- (N/2) + 1);
		// create the comparers(threads/workers)
		for(int i = 1; i <= N/2; i++){
			Comparer comparer = new Comparer("Thread" + i, semaphore);
			COMPARER_LIST.add(comparer);
		}
		
		// generate the instruction sets or basically draw the wires
		InstructionSetsGenerator.generateAndAssignInstructions();

		for(Comparer c: COMPARER_LIST){
			c.buildInstructionSet();	
		}
	
		double start = System.nanoTime();
		for(int i = 0; i < COMPARER_LIST.get(0).toSwaps.size()/3; i++){
			for(Comparer c: COMPARER_LIST){
				c.compare();
			}
		}
		System.out.println((System.nanoTime() - start)/1_000_000_000);
	}
	
	private static int[] generateNumbers() {
		
		ArrayList<Integer> list = new ArrayList<>();
	    Random random = new Random();

	    list.add(0);	// initial value -- convenience
	    for (int i = 0; i < 1024 ; i++){
	        list.add(random.nextInt(255));
	    }
	    
	    
	    int[] ret = new int[list.size()];
	    for(int i = 0;i < ret.length;i++)
	      ret[i] = list.get(i);
	    return ret;
	}

	public void process() throws InterruptedException{
		
		System.out.println("Starting: ");
		System.out.println("Number of Integers: " + N);
		

		/*
		 * 
		 *  Setup
		 */
		
		// create the comparers(threads/workers)
		Semaphore semaphore = new Semaphore(- (N/2) + 1);
		
		for(int i = 1; i <= N/2; i++){
			Comparer comparer = new Comparer("Thread" + i, semaphore);
			COMPARER_LIST.add(comparer);
		}
		
		// generate the instruction sets or basically draw the wires
		InstructionSetsGenerator.generateAndAssignInstructions();

		for(Comparer c: COMPARER_LIST){
			c.buildInstructionSet();	
		}
		

		/*
		 * 
		 * Magic 
		*/
//		printNumbers("Initial Numbers are");
		ExecutorService executor = Executors.newFixedThreadPool(2048);

		for(Comparer c: COMPARER_LIST){
//			System.out.println(c.getName() + ": " + c.instructions.toString());
//			c.start();
			executor.execute(c);
		}
		
		double start = System.nanoTime();
		System.out.println("ALL THREADS just started!\n");
		
		System.out.println("TOTAL BLOCKS:" + TOTAL_BLOCKS);
		for(int i = 1; i <= TOTAL_BLOCKS; i++){
			for(int j = 0; j < N/2; j++){
				semaphore.acquire();
			}
//			System.out.println("Available permits:" + semaphore.availablePermits());
		}
		
		for(Comparer c: COMPARER_LIST){
			c.join();
		}
//		BitonicSorter.IS_FINISHED = true;
		System.out.println((System.nanoTime() - start)/1_000_000_000);
		
		System.out.println("FINISHED");
		
		printNumbers("\nFinal Numbers are:");
		printNumbers("");
		System.out.println("Are numbers sorted? " + isNumbersSorted());
		
//		for(Comparer c: COMPARER_LIST){
//			if(c.isAlive()){
//				System.out.println("Someone is still alive!");
//			}
//		}
	}

	
	/*
	 * 
	* Utility functions
	*/
	private boolean isNumbersSorted(){
		int max = 0;
		
		for(int i: NUMBERS){
			if(i < max){
				return false;
			}
			max = i;
		}
		return true;
	}
	
	private void printNumbers(String header) {
		if (!SHOULD_LOG){
			return;
		}
		if(!header.isEmpty()){
			System.out.println(header);
		}
		for(int i: NUMBERS){
			System.out.print(i + ",");
			if(i % 50 == 0 && i!= 0){
				System.out.println();
			}
		}
		System.out.println("");
	}
	
	private static int sumOfOneToN(int n) {
		int total = 0;
		for(int i = 1; i <= n; i++){
			total+=i;
		}
		return total;
	}
